import React from 'react'
import {Player} from 'video-react'

function VideoPlayer() {
    return (
              <Player
                playsInline
                src={props.src}
                width={props.width}
                height={props.height}
                fluid={props.fluid}
                autoPlay={props.autoPlay}>
                </Player>
          );
  }

  export default VideoPlayer;
